const DiaryItem = ({author, content, created_date, emotion, id}) => {
    return (
        <div className="DiaryItem_container">
            <div>
                <h3>일기 리스트</h3>
            </div>
            <span>작성자: {author} | 감정점수 : {emotion}</span>
            <br/>
            <span>날짜 : {created_date}</span>
            <div>
                <span>{content}</span>
            </div>
        </div>
    )
}

export default DiaryItem;
